import React, { Component} from "react";
import Connection from "./Connection";
import Teleoperation from "./Teleoperation";
import RobotState from "./RobotState";
import { Row, Col, Container, Button } from "react-bootstrap";

class Home extends Component{
    constructor(props) {
        super(props);
        this.state = {
            ros: null
        };
        this.setRos = this.setRos.bind(this);
    }

    setRos(ros) {
        this.setState({ros: ros});
    }

    render() {
        return (
            <div>
                <Container>
                    <h1 className="text-center mt-5"> Robot Control Page</h1>

                    <Row className="mb-4">
                        <Col>
                            <Connection setRos={this.setRos}/>
                        </Col>
                    </Row>

                    <Row className="mb-4">
                        <Col className="my-5">
                            <Teleoperation ros={this.state.ros}/>
                        </Col>
                        <Col className="my-5">
                            <h3>MAP</h3>
                            <p>This region will be used later for displaying a map</p>
                        </Col>
                    </Row>

                    <Row className="mb-4">
                        <Col className="my-5">
                            <RobotState/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
